import React, { useEffect, useState } from 'react';
import api from '../api';

function StatusBadge({ value }){
  const map = {
    enviada: 'secondary',
    aceita: 'success',
    recusada: 'danger'
  };
  const cls = map[value] || 'secondary';
  return <span className={`badge bg-${cls}`}>{value}</span>;
}

export default function SalesList(){
  const [items,setItems] = useState([]);
  const [cliente_nome,setCliente] = useState('');
  const [cliente_documento,setDoc] = useState('');
  const [status,setStatus] = useState('');
  const [banco,setBanco] = useState('');
  const [loading, setLoading] = useState(false);

  async function fetch(){
    setLoading(true);
    try{
      const { data } = await api.get('/sales', { params: { cliente_nome, cliente_documento, status, banco } });
      setItems(data);
    } finally { setLoading(false); }
  }

  useEffect(()=>{ fetch(); },[]);

  return (
    <div>
      <div className="d-flex align-items-center justify-content-between mb-3">
        <h5 className="mb-0 d-flex align-items-center gap-2"><i className="bi bi-table"></i>Vendas</h5>
        <button className="btn btn-outline-secondary btn-sm" onClick={fetch}>
          <i className="bi bi-arrow-clockwise me-1"></i>Atualizar
        </button>
      </div>

      <div className="row g-2 mb-3">
        <div className="col-md-3"><input className="form-control" placeholder="Cliente" value={cliente_nome} onChange={e=>setCliente(e.target.value)} /></div>
        <div className="col-md-3"><input className="form-control" placeholder="CPF/CNPJ" value={cliente_documento} onChange={e=>setDoc(e.target.value)} /></div>
        <div className="col-md-3"><input className="form-control" placeholder="Banco" value={banco} onChange={e=>setBanco(e.target.value)} /></div>
        <div className="col-md-2">
          <select className="form-select" value={status} onChange={e=>setStatus(e.target.value)}>
            <option value="">Status</option>
            <option value="enviada">Enviada</option>
            <option value="aceita">Aceita</option>
            <option value="recusada">Recusada</option>
          </select>
        </div>
        <div className="col-md-1 d-grid"><button className="btn btn-secondary" onClick={fetch}><i className="bi bi-search"></i></button></div>
      </div>

      <div className="table-responsive">
        <table className="table table-hover align-middle">
          <thead className="table-dark">
            <tr>
              <th>ID</th>
              <th>Cliente</th>
              <th>Documento</th>
              <th>Valor</th>
              <th>Banco</th>
              <th>Status</th>
              <th>Comissão</th>
              <th>Data</th>
            </tr>
          </thead>
          <tbody>
            {items.map(v => (
              <tr key={v.id}>
                <td>{v.id}</td>
                <td>{v.cliente_nome}</td>
                <td>{v.cliente_documento}</td>
                <td>{v.valor?.toLocaleString('pt-BR',{style:'currency',currency:'BRL'})}</td>
                <td>{v.banco}</td>
                <td><StatusBadge value={v.status}/></td>
                <td>{v.comissao?.toLocaleString('pt-BR',{style:'currency',currency:'BRL'})}</td>
                <td>{v.data_venda ? new Date(v.data_venda).toLocaleString('pt-BR') : ''}</td>
              </tr>
            ))}
            {(!loading && items.length===0) && (
              <tr><td colSpan="8" className="text-center text-muted py-4">Nenhum registro encontrado</td></tr>
            )}
            {loading && (
              <tr><td colSpan="8" className="text-center py-4"><div className="spinner-border" role="status"><span className="visually-hidden">Carregando…</span></div></td></tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
}
